INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (302, 450, 0, 3, 14, "2024/12/31 11:59:59", 0, 119901, 1, "ミヤコ（クリスマス）", 0, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", "みやこ", 1, 1, 0, 1, "2024/12/22 12:00:00", 0, 0, 119901, 119901, 0, 2.17, 119901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (190, 450, 0, 3, 6, "2025/03/15 14:59:59", 0, 120001, 1, "シズル（ノワール）", 0, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", "しずる", 1, 5, 0, 5, "2025/03/10 12:00:00", 0, 0, 120001, 120001, 0, 2.375, 120001);
