INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (283, 450, 0, 3, 1, "2025/01/20 11:59:59", 0, 120701, 1, "シェフィ（ニューイヤー）", 0, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", "しぇふぃ", 1, 4, 0, 22, "2025/01/15 15:00:00", 0, 0, 120701, 120701, 0, 1.84, 120701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (193, 450, 0, 1, 2, "2030/12/31 15:00:00", 0, 120801, 1, "ルカ（ニューイヤー）", 0, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", "るか", 1, 4, 0, 22, "2023/10/16 15:00:00", 0, 0, 120801, 120801, 0, 1.3, 120801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (424, 450, 0, 3, 12, "2025/01/20 11:59:59", 0, 120901, 1, "イリヤ（ニューイヤー）", 0, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", "いりや", 2, 3, 0, 38, "2025/01/15 15:00:00", 0, 0, 120901, 120901, 0, 1.425, 120901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (164, 450, 0, 3, 1, "2025/02/24 11:59:59", 0, 121001, 1, "ペコリーヌ（オーバーロード）", 0, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", "ぺこりーぬ", 1, 5, 0, 41, "2025/02/20 12:00:00", 0, 0, 121001, 121001, 0, 2.25, 121001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (588, 450, 0, 3, 1, "2025/02/24 11:59:59", 0, 121101, 1, "キャル（オーバーロード）", 0, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", "きゃる", 2, 7, 0, 42, "2025/02/20 12:00:00", 0, 0, 121101, 121101, 0, 2.07, 121101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (260, 450, 0, 1, 6, "2030/12/31 15:00:00", 0, 121201, 1, "ラビリスタ（オーバーロード）", 0, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", "らびりすた", 1, 4, 0, 40, "2023/11/16 15:00:00", 0, 0, 121201, 121201, 0, 1.55, 121201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (731, 450, 0, 3, 3, "2030/12/31 15:00:00", 0, 121301, 0, "クルミ（ステージ）", 0, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", "くるみ", 1, 3, 0, 3, "2022/03/03 19:00:00", 0, 0, 121301, 121301, 0, 1.9, 121301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (742, 450, 0, 3, 15, "2030/12/31 15:00:00", 0, 121401, 0, "ミサキ（ステージ）", 0, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", "みさき", 2, 7, 0, 7, "2022/03/15 15:00:00", 0, 0, 121401, 121401, 0, 2.27, 121401);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (590, 450, 0, 3, 12, "2025/04/30 11:59:59", 0, 121501, 1, "アユミ（怪盗）", 0, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", "あゆみ", 1, 6, 0, 6, "2025/04/26 12:00:00", 0, 0, 121501, 121501, 0, 2.0, 121501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (292, 450, 0, 3, 17, "2030/12/31 15:00:00", 0, 121601, 0, "イノリ（怪盗）", 0, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", "いのり", 1, 3, 0, 3, "2022/04/15 15:00:00", 0, 0, 121601, 121601, 0, 1.425, 121601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (421, 0, 0, 3, 0, "2030/12/31 15:00:00", 0, 121701, 1, "アキノ（アキノ＆サレン）", 0, "", "あきの", 0, 0, 1, 0, "2015/04/01 15:00:00", 0, 180901, 121701, 0, 0, 0.0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (421, 0, 0, 3, 0, "2030/12/31 15:00:00", 0, 121801, 1, "サレン（アキノ＆サレン）", 0, "", "されん", 0, 0, 1, 0, "2015/04/01 15:00:00", 0, 180901, 121801, 0, 0, 0.0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (293, 450, 0, 3, 12, "2030/12/31 15:00:00", 0, 121901, 0, "アンナ（パイレーツ）", 0, "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", "あんな", 2, 5, 0, 5, "2022/05/15 15:00:00", 0, 0, 121901, 121901, 0, 2.125, 121901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (380, 450, 0, 3, 14, "2030/12/31 15:00:00", 0, 122001, 0, "シノブ（パイレーツ）", 0, "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", "しのぶ", 1, 3, 0, 3, "2022/05/03 19:00:00", 0, 0, 122001, 122001, 0, 1.425, 122001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (731, 450, 0, 1, 9, "2030/12/31 15:00:00", 0, 122101, 1, "アオイ（キャンプ）", 0, "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", "あおい", 1, 35, 0, 35, "2024/04/18 15:00:00", 0, 0, 122101, 122101, 0, 1.97, 122101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (419, 450, 0, 3, 8, "2030/12/31 15:00:00", 0, 122201, 0, "ユカリ（キャンプ）", 0, "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", "ゆかり", 1, 4, 0, 4, "2022/05/31 12:00:00", 0, 0, 122201, 122201, 0, 1.84, 122201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (564, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 122301, 0, "ヴァンピィ", 0, "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", "うぁんぴぃ", 2, 43, 0, 43, "2022/06/15 15:00:00", 0, 0, 122301, 122301, 0, 1.425, 122301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (264, 450, 0, 1, 8, "2030/12/31 15:00:00", 0, 122401, 1, "ヒヨリ（サマー）", 0, "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", "ひより", 1, 1, 0, 1, "2024/06/17 15:00:00", 0, 0, 122401, 122401, 0, 2.42, 122401);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (250, 450, 0, 3, 0, "2025/08/31 11:59:59", 0, 122501, 1, "レイ（サマー）", 0, "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", "れい", 1, 4, 0, 4, "2025/08/22 12:00:00", 0, 0, 122501, 122501, 0, 1.965, 122501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (554, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 122601, 0, "ユイ（サマー）", 0, "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", "ゆい", 2, 7, 0, 7, "2022/07/15 15:00:00", 0, 0, 122601, 122601, 0, 2.27, 122601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (812, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 122701, 0, "キョウカ（サマー）", 0, "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", "きょうか", 2, 7, 0, 7, "2022/08/15 15:00:00", 0, 0, 122701, 122701, 0, 1.92, 122701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (237, 450, 0, 1, 0, "2030/12/31 15:00:00", 0, 122801, 1, "ミソギ（サマー）", 0, "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", "みそぎ", 1, 1, 0, 1, "2024/07/16 15:00:00", 0, 0, 122801, 122801, 0, 2.295, 122801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (361, 450, 0, 3, 0, "2025/08/31 11:59:59", 0, 122901, 1, "ミミ（サマー）", 0, "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", "みみ", 1, 5, 0, 5, "2025/08/22 12:00:00", 0, 0, 122901, 122901, 0, 2.25, 122901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (746, 450, 0, 3, 0, "2025/11/03 11:59:59", 0, 123001, 1, "アメス", 0, "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", "あめす", 2, 44, 0, 44, "2025/10/31 12:00:00", 0, 0, 123001, 123001, 0, 2.27, 123001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (793, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 123101, 0, "マホ（エクスプローラー）", 0, "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", "まほ", 2, 7, 0, 7, "2022/09/03 19:00:00", 0, 0, 123101, 123101, 0, 1.795, 123101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (256, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 123201, 0, "アヤネ（エクスプローラー）", 0, "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", "あやね", 1, 3, 0, 3, "2022/09/15 15:00:00", 0, 0, 123201, 123201, 0, 1.425, 123201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (350, 450, 0, 3, 0, "2025/09/30 11:59:59", 0, 123301, 1, "ネア", 0, "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", "ねあ", 1, 1, 0, 0, "2025/09/16 15:00:00", 0, 0, 123301, 123301, 0, 1.62, 123301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 3, 0, "2030/12/31 15:00:00", 0, 123401, 0, "ジュン（キャンプ）", 0, "", "じゅん", 0, 5, 0, 5, "2015/04/01 15:00:00", 0, 0, 123401, 0, 0, 0.0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (583, 450, 0, 1, 0, "2030/12/31 15:00:00", 0, 123501, 1, "リン（ハロウィン）", 0, "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", "りん", 1, 6, 0, 6, "2024/09/17 15:00:00", 0, 0, 123501, 123501, 0, 2.34, 123501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (262, 450, 0, 3, 0, "2025/11/30 11:59:59", 0, 123601, 1, "トモ（ハロウィン）", 0, "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", "とも", 1, 4, 0, 4, "2025/11/14 15:00:00", 0, 0, 123601, 123601, 0, 1.965, 123601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (741, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 123701, 0, "ナナカ（ハロウィン）", 0, "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", "ななか", 2, 7, 0, 21, "2022/10/15 15:00:00", 0, 0, 123701, 123701, 0, 2.07, 123701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (238, 450, 0, 3, 0, "2025/11/14 14:59:59", 0, 123801, 1, "クリスティーナ（ワイルド）", 0, "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", "くりすてぃーな", 1, 1, 0, 1, "2025/11/03 12:00:00", 0, 0, 123801, 123801, 0, 2.295, 123801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (183, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 123901, 0, "マツリ（ワイルド）", 0, "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", "まつり", 1, 2, 0, 2, "2022/11/15 15:00:00", 0, 0, 123901, 123901, 0, 2.125, 123901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (438, 450, 0, 3, 0, "2024/12/31 11:59:59", 0, 124001, 1, "アカリ（クリスマス）", 0, "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", "あかり", 2, 7, 0, 7, "2024/12/22 12:00:00", 0, 0, 124001, 124001, 0, 2.07, 124001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (433, 450, 0, 1, 0, "2030/12/31 15:00:00", 0, 124101, 1, "ヨリ（クリスマス）", 0, "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", "より", 2, 6, 0, 6, "2024/11/16 15:00:00", 0, 0, 124101, 124101, 0, 1.965, 124101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (144, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 124201, 0, "ジュン（クリスマス）", 0, "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", "じゅん", 1, 5, 0, 5, "2022/12/23 12:00:00", 0, 0, 124201, 124201, 0, 2.07, 124201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (577, 0, 0, 3, 0, "2030/12/31 15:00:00", 0, 124301, 1, "アン（アン＆グレア）", 0, "", "あん", 0, 0, 1, 0, "2015/04/01 15:00:00", 0, 181001, 124301, 0, 0, 0.0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (577, 0, 0, 3, 0, "2030/12/31 15:00:00", 0, 124401, 1, "グレア（アン＆グレア）", 0, "", "ぐれあ", 0, 0, 1, 0, "2015/04/01 15:00:00", 0, 181001, 124401, 0, 0, 0.0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (707, 450, 0, 3, 0, "2025/01/20 11:59:59", 0, 124501, 1, "ホマレ（ニューイヤー）", 0, "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", "ほまれ", 2, 7, 0, 21, "2025/01/15 15:00:00", 0, 0, 124501, 124501, 0, 2.07, 124501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (698, 450, 0, 3, 0, "2025/01/20 11:59:59", 0, 124601, 1, "ミサト（ニューイヤー）", 0, "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", "みさと", 2, 7, 0, 21, "2025/01/15 15:00:00", 0, 0, 124601, 124601, 0, 2.44, 124601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (590, 450, 0, 1, 0, "2030/12/31 15:00:00", 0, 124701, 1, "ミツキ（ニューイヤー）", 0, "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", "みつき", 1, 7, 0, 46, "2024/12/16 15:00:00", 0, 0, 124701, 124701, 0, 2.24, 124701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (423, 450, 0, 3, 0, "2025/02/24 11:59:59", 0, 124801, 1, "ノゾミ（リベレイター）", 0, "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", "のぞみ", 1, 4, 0, 0, "2025/02/20 12:00:00", 0, 0, 124801, 124801, 0, 2.14, 124801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (170, 450, 0, 1, 0, "2030/12/31 15:00:00", 0, 124901, 1, "カヤ（リベレイター）", 0, "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", "かや", 1, 1, 0, 0, "2025/01/16 15:00:00", 0, 0, 124901, 124901, 0, 1.965, 124901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (221, 450, 0, 3, 0, "2025/02/24 11:59:59", 0, 125001, 1, "ムイミ（リベレイター）", 0, "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", "むいみ", 1, 5, 0, 0, "2025/02/20 12:00:00", 0, 0, 125001, 125001, 0, 1.965, 125001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (825, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 125101, 0, "タマキ（カフェ）", 0, "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", "たまき", 1, 8, 0, 47, "2023/03/03 19:00:00", 0, 0, 125101, 125101, 0, 2.24, 125101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (463, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 125201, 0, "モニカ（カフェ）", 0, "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", "もにか", 1, 4, 0, 4, "2023/03/10 12:00:00", 0, 0, 125201, 125201, 0, 1.965, 125201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (752, 450, 0, 3, 0, "2025/04/30 11:59:59", 0, 125301, 1, "コッコロ（レンジャー）", 0, "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", "こっころ", 1, 6, 0, 6, "2025/04/26 12:00:00", 0, 0, 125301, 125301, 0, 2.07, 125301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (710, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 125401, 0, "シオリ（レンジャー）", 0, "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", "しおり", 1, 8, 0, 8, "2023/04/10 12:00:00", 0, 0, 125401, 125401, 0, 2.09, 125401);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (443, 450, 0, 3, 0, "2025/05/31 11:59:59", 0, 125501, 1, "ジータ（ウォーロック）", 0, "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", "じーた", 2, 7, 0, 50, "2025/05/15 15:00:00", 0, 0, 125501, 125501, 0, 1.92, 125501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (267, 450, 0, 3, 0, "2025/05/31 11:59:59", 0, 125601, 1, "ビカラ", 0, "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", "びから", 1, 51, 0, 0, "2025/05/15 15:00:00", 0, 0, 125601, 125601, 0, 2.09, 125601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (579, 450, 0, 1, 0, "2030/12/31 15:00:00", 0, 125701, 1, "カリン（アルケミスト）", 0, "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", "かりん", 2, 7, 0, 9, "2025/04/16 15:00:00", 0, 0, 125701, 125701, 0, 2.24, 125701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (464, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 125801, 0, "リリ（フォールン）", 0, "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", "りり", 1, 3, 0, 0, "2023/04/17 12:00:00", 0, 0, 125801, 125801, 0, 2.09, 125801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 3, 0, "2030/12/31 15:00:00", 0, 125901, 1, "カヤ（リベレイター）", 0, "", "かや", 0, 1, 0, 1, "2015/04/01 15:00:00", 0, 0, 125901, 0, 0, 0.0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (406, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 126001, 0, "クリア（フォールン）", 0, "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", "くりあ", 1, 0, 0, 0, "2023/10/31 12:00:00", 0, 0, 126001, 126001, 0, 2.09, 126001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (480, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 126101, 0, "プレシア（フォールン）", 0, "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", "ぷれしあ", 2, 44, 0, 53, "2023/11/15 15:00:00", 0, 0, 126101, 126101, 0, 2.09, 126101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (568, 450, 0, 3, 0, "2025/06/20 11:59:59", 0, 126201, 1, "イリヤ（儀装束）", 0, "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", "いりや", 2, 3, 0, 3, "2025/06/10 12:00:00", 0, 0, 126201, 126201, 0, 2.09, 126201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (456, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 126301, 0, "ユキ（儀装束）", 0, "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", "ゆき", 2, 7, 0, 9, "2023/06/15 15:00:00", 0, 0, 126301, 126301, 0, 2.07, 126301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (373, 450, 0, 3, 0, "2025/11/03 11:59:59", 0, 126401, 1, "クローチェ", 0, "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", "くろーちぇ", 1, 1, 0, 1, "2025/10/31 12:00:00", 0, 0, 126401, 126401, 0, 2.09, 126401);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (740, 450, 0, 3, 0, "2025/11/03 11:59:59", 0, 126501, 1, "ライラエル", 0, "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", "らいらえる", 2, 7, 0, 0, "2025/10/31 12:00:00", 0, 0, 126501, 126501, 0, 1.965, 126501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (650, 450, 0, 3, 0, "2025/08/15 14:59:59", 0, 126601, 1, "ネネカ（サマー）", 0, "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", "ねねか", 2, 7, 0, 7, "2025/08/10 12:00:00", 0, 0, 126601, 126601, 0, 2.04, 126601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (224, 450, 0, 1, 0, "2030/12/31 15:00:00", 0, 126701, 1, "アキノ（サマー）", 0, "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", "あきの", 1, 5, 0, 5, "2025/06/17 15:00:00", 0, 0, 126701, 126701, 0, 1.965, 126701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (159, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 126801, 0, "ユカリ（サマー）", 0, "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", "ゆかり", 1, 5, 0, 5, "2023/07/15 15:00:00", 0, 0, 126801, 126801, 0, 1.97, 126801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (682, 450, 0, 3, 0, "2025/08/31 11:59:59", 0, 126901, 1, "ランファ（サマー）", 0, "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", "らんふぁ", 2, 7, 0, 21, "2025/08/22 12:00:00", 0, 0, 126901, 126901, 0, 1.965, 126901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (133, 450, 0, 1, 0, "2030/12/31 15:00:00", 0, 127001, 1, "クウカ（サマー）", 0, "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", "くうか", 1, 2, 0, 52, "2025/07/16 15:00:00", 0, 0, 127001, 127001, 0, 1.97, 127001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (255, 450, 0, 3, 0, "2025/08/31 11:59:59", 0, 127101, 1, "シノブ（サマー）", 0, "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", "しのぶ", 1, 5, 0, 46, "2025/08/22 12:00:00", 0, 0, 127101, 127101, 0, 2.09, 127101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (804, 450, 0, 3, 0, "2025/09/30 11:59:59", 0, 127201, 1, "キャル（編入生）", 0, "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", "きゃる", 2, 7, 0, 7, "2025/09/16 15:00:00", 0, 0, 127201, 127201, 0, 2.09, 127201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (750, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 127301, 0, "スズナ（編入生）", 0, "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", "すずな", 1, 8, 0, 8, "2023/09/15 15:00:00", 0, 0, 127301, 127301, 0, 2.09, 127301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 3, 0, "2030/12/31 15:00:00", 0, 127401, 1, "ビカラ（コラボ）", 0, "", "びから", 0, 1, 0, 1, "2015/04/01 15:00:00", 0, 0, 127401, 0, 0, 0.0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (304, 450, 0, 3, 0, "2024/11/18 11:59:59", 0, 127501, 1, "サレン（サラサリア）", 0, "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", "されん", 1, 4, 0, 4, "2024/11/11 12:00:00", 0, 0, 127501, 127501, 0, 2.09, 127501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (157, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 127601, 0, "ルカ（サラサリア）", 0, "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", "るか", 1, 4, 0, 4, "2023/10/15 15:00:00", 0, 0, 127601, 127601, 0, 1.965, 127601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (693, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 127701, 0, "リンド", 0, "【魔法】後衛で、メイド業に奔走する双子ドラゴンの姉。\nＵＢのフィールド展開中は攻撃、防御、ＴＰ回復と多彩な\n支援スキルの効果が再発動し味方を手厚くサポートする。", "りんど", 2, 6, 0, 48, "2024/10/10 12:00:00", 0, 0, 127701, 127701, 0, 1.965, 127701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (706, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 127801, 0, "ヴルム", 0, "【魔法】後衛で、文句を言いつつ働く双子ドラゴンの妹。\nダメージと魔法防御力ダウンを両立するスキルを持つが、\n目を離すと【サボりの誘惑】に負け、手を抜いてしまう。", "うるむ", 2, 7, 0, 47, "2024/10/18 12:00:00", 0, 0, 127801, 127801, 0, 1.965, 127801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (372, 450, 0, 3, 0, "2024/12/15 14:59:59", 0, 127901, 1, "ペコリーヌ（クリスマス）", 0, "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", "ぺこりーぬ", 2, 5, 0, 5, "2024/12/09 12:00:00", 0, 0, 127901, 127901, 0, 1.965, 127901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (723, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 128001, 0, "クレジッタ（クリスマス）", 0, "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", "くれじった", 1, 35, 0, 35, "2023/12/15 15:00:00", 0, 0, 128001, 128001, 0, 2.09, 128001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (580, 0, 0, 3, 0, "2030/12/31 15:00:00", 0, 128101, 1, "シズル（シズル&リノ）", 0, "", "しずる", 0, 0, 1, 0, "2015/04/01 15:00:00", 0, 181101, 128101, 0, 0, 0.0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (580, 0, 0, 3, 0, "2030/12/31 15:00:00", 0, 128201, 1, "リノ（シズル&リノ）", 0, "", "りの", 0, 0, 1, 0, "2015/04/01 15:00:00", 0, 181101, 128201, 0, 0, 0.0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (191, 450, 0, 1, 0, "2030/12/31 15:00:00", 0, 128301, 1, "イノリ（ニューイヤー）", 0, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", "いのり", 1, 3, 1, 38, "2023/12/31 12:00:00", 0, 0, 128301, 128301, 0, 2.09, 128301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (801, 450, 0, 3, 0, "2025/01/15 14:59:59", 0, 128401, 1, "ハツネ（ニューイヤー）", 0, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", "はつね", 2, 7, 0, 21, "2025/01/09 12:00:00", 0, 0, 128401, 128401, 0, 2.09, 128401);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (739, 450, 0, 3, 0, "2025/01/15 14:59:59", 0, 128501, 1, "カスミ（ニューイヤー）", 0, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", "かすみ", 2, 7, 0, 21, "2025/01/09 12:00:00", 0, 0, 128501, 128501, 0, 2.09, 128501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 3, 0, "2030/12/31 15:00:00", 0, 128601, 1, "リリ（フォールン）", 0, "", "りり", 0, 1, 0, 1, "2015/04/01 15:00:00", 0, 0, 128601, 0, 0, 0.0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (226, 450, 0, 3, 0, "2025/02/15 14:59:59", 0, 128701, 1, "ヒヨリ（アストラル）", 0, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", "ひより", 1, 1, 0, 0, "2025/02/10 12:00:00", 0, 0, 128701, 128701, 0, 2.09, 128701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (194, 450, 0, 1, 0, "2030/12/31 15:00:00", 0, 128801, 1, "レイ（アストラル）", 0, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", "れい", 1, 4, 0, 0, "2025/08/16 15:00:00", 0, 0, 128801, 128801, 0, 1.965, 128801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (772, 450, 0, 3, 0, "2025/02/15 14:59:59", 0, 128901, 1, "ユイ（アストラル）", 0, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", "ゆい", 2, 7, 0, 0, "2025/02/10 12:00:00", 0, 0, 128901, 128901, 0, 2.09, 128901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (800, 450, 0, 3, 0, "2025/11/03 11:59:59", 0, 129001, 1, "エリス", 0, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", "えりす", 2, 7, 0, 0, "2025/10/31 12:00:00", 0, 0, 129001, 129001, 0, 2.09, 129001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (708, 450, 0, 3, 0, "2025/03/15 14:59:59", 0, 129301, 1, "ユニ（ウィンター）", 0, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", "ゆに", 1, 7, 0, 7, "2025/03/10 12:00:00", 0, 0, 129301, 129301, 0, 2.09, 129301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (188, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 129401, 0, "クロエ（ウィンター）", 0, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", "くろえ", 1, 2, 0, 2, "2024/03/18 12:00:00", 0, 0, 129401, 129401, 0, 2.09, 129401);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (247, 450, 0, 3, 0, "2025/12/15 14:59:59", 0, 129501, 1, "チエル（ウィンター）", 0, "【物理】前衛で、ちぇるっとちぇるるな水着のちえるん。\nステータスアップで溜まる【ちぇる】を、自身の火力や\n支援能力に還元して、真冬の真夏をちぇらるれれぽぱぴ？", "ちえる", 1, 1, 0, 1, "2025/11/30 12:00:00", 0, 0, 129501, 129501, 0, 2.09, 129501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (550, 450, 0, 3, 0, "2025/11/03 11:59:59", 0, 129601, 1, "アネモネ", 0, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", "あねもね", 1, 0, 0, 0, "2025/10/31 12:00:00", 0, 0, 129601, 129601, 0, 2.09, 129601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (540, 450, 0, 3, 0, "2025/11/03 11:59:59", 0, 129701, 1, "ネフィ＝ネラ", 0, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", "ねふぃーねら", 1, 0, 0, 0, "2025/10/31 12:00:00", 0, 0, 129701, 129701, 0, 2.09, 129701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (269, 450, 0, 3, 0, "2025/04/30 11:59:59", 0, 129801, 1, "マコト（コマンダー）", 0, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", "まこと", 1, 5, 0, 5, "2025/04/26 12:00:00", 0, 0, 129801, 129801, 0, 2.09, 129801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (294, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 129901, 0, "エリコ（コマンダー）", 0, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", "えりこ", 1, 6, 0, 48, "2024/04/15 15:00:00", 0, 0, 129901, 129901, 0, 1.84, 129901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (150, 450, 0, 3, 0, "2025/11/14 14:59:59", 0, 130001, 1, "ヤマト", 0, "【物理】前衛で、豪胆にスリルを嗜む盗賊ギルドの長女。\n最前線で命を張りながら、獲得した【バンディダイス】の\n消費によって自らを大幅強化し、有象無象を地に伏せる。", "やまと", 1, 4, 0, 0, "2025/11/03 12:00:00", 0, 0, 130001, 130001, 0, 2.09, 130001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (535, 450, 0, 3, 0, "2025/11/14 14:59:59", 0, 130101, 1, "ワカナ", 0, "【物理】中衛の、貧乏クジを引きがちな盗賊ギルド次女。\n召喚したスキッドがワカナをかばって前線に立ち、自身は\n攻撃支援にＨＰとＴＰ回復まで、献身的に味方を支える。", "わかな", 1, 7, 0, 9, "2025/11/03 12:00:00", 0, 0, 130101, 130101, 0, 2.09, 130101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (371, 450, 0, 3, 0, "2025/11/14 14:59:59", 0, 130201, 1, "フブキ", 0, "【物理】中衛の、ナマイキで超天才な盗賊ギルドの三女。\n【味方バリアー♡】で自分へのダメージを味方に押し付け\nＨＰ最大でダメージアップする範囲攻撃で敵を蹂躙する。", "ふぶき", 1, 5, 0, 0, "2025/11/03 12:00:00", 0, 0, 130201, 130201, 0, 1.84, 130201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 3, 0, "2030/12/31 15:00:00", 0, 130601, 1, "レイ（アストラル）", 0, "", "れい", 0, 4, 0, 1, "2015/04/01 15:00:00", 0, 0, 130601, 0, 0, 0.0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (563, 450, 0, 3, 0, "2025/05/15 14:59:59", 0, 130701, 1, "キョウカ（スプリング）", 0, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", "きょうか", 2, 7, 0, 7, "2025/05/03 19:00:00", 0, 0, 130701, 130701, 0, 1.92, 130701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (558, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 130801, 0, "スズメ（スプリング）", 0, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", "すずめ", 2, 7, 0, 7, "2024/05/15 15:00:00", 0, 0, 130801, 130801, 0, 1.84, 130801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (440, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 130901, 0, "クルル", 0, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", "くるる", 2, 7, 0, 7, "2024/06/15 15:00:00", 0, 0, 130901, 130901, 0, 2.09, 130901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (702, 450, 0, 3, 0, "2025/06/20 11:59:59", 0, 131001, 1, "マホ（ドリームパーク）", 0, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", "まほ", 2, 7, 0, 7, "2025/06/10 12:00:00", 0, 0, 131001, 131001, 0, 1.84, 131001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (165, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 131101, 0, "ネア（サマー）", 0, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", "ねあ", 1, 2, 0, 52, "2024/06/30 12:00:00", 0, 0, 131101, 131101, 0, 2.09, 131101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (753, 450, 0, 3, 0, "2025/07/23 11:59:59", 0, 131201, 1, "ミソラ（サマー）", 0, "【魔法】後衛で夏の盛りにイイコトをする溌溂水着少女★\n【PSI★ストーム】をチャージし、連続攻撃で敵を殲滅し\nて、継続ＴＰ回復やバリアで抜け目なく味方を支援する。", "みそら", 2, 54, 0, 54, "2025/07/10 12:00:00", 0, 0, 131201, 131201, 0, 2.09, 131201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 3, 0, "2030/12/31 15:00:00", 0, 131301, 1, "リリ", 0, "", "りり", 0, 1, 1, 1, "2015/04/01 15:00:00", 0, 0, 131301, 0, 0, 0.0, 0);
