INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (399, 450, 0, 3, 0, "2025/07/23 11:59:59", 0, 131601, 1, "リリ（サマー）", 0, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", "りり", 1, 4, 0, 4, "2025/07/10 12:00:00", 0, 0, 131601, 131601, 0, 1.92, 131601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (743, 450, 0, 3, 0, "2025/08/15 14:59:59", 0, 131701, 1, "アメス（サマー）", 0, "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", "あめす", 2, 44, 0, 53, "2025/08/10 12:00:00", 0, 0, 131701, 131701, 0, 1.92, 131701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (709, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 131801, 0, "ホマレ（サマー）", 0, "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", "ほまれ", 2, 7, 0, 21, "2024/08/15 15:00:00", 0, 0, 131801, 131801, 0, 2.09, 131801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (725, 450, 1, 1, 0, "2030/12/31 15:00:00", 0, 131901, 1, "エミリア（サマー）", 0, "【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。", "えみりあ", 2, 7, 1, 23, "2024/08/31 12:00:00", 0, 0, 131901, 131901, 0, 2.09, 131901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (775, 450, 1, 3, 0, "2025/10/24 11:59:59", 0, 132001, 1, "エキドナ（サマー）", 0, "【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", "えきどな", 2, 7, 0, 21, "2025/10/10 12:00:00", 0, 0, 132001, 132001, 0, 2.09, 132001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (146, 450, 1, 3, 0, "2025/10/24 11:59:59", 0, 132101, 1, "レム（サマー）", 0, "【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", "れむ", 1, 13, 0, 24, "2025/10/10 12:00:00", 0, 0, 132101, 132101, 0, 2.09, 132101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (721, 450, 0, 3, 0, "2025/10/31 11:59:59", 0, 132201, 1, "ノゾミ（アルケミスト）", 0, "【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", "のぞみ", 2, 7, 0, 7, "2025/10/24 12:00:00", 0, 0, 132201, 132201, 0, 1.84, 132201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (754, 450, 0, 3, 0, "2025/12/15 14:59:59", 0, 132301, 1, "ルイズマリー", 0, "【魔法】後衛で、底知れぬ叡智を秘めた天才錬金術師。\n高い方の防御力でダメージを受ける調和状態を付与し、\n２回まで性能が上昇していくＵＢで、妄想を爆発させる。", "るいずまりー", 2, 7, 0, 7, "2025/11/30 12:00:00", 0, 0, 132301, 132301, 0, 2.09, 132301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (501, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 132401, 0, "イロハ", 0, "【物理】中衛で、大きな体で無邪気に遊び回る天才剣士。\n戦いの中で【剣圧】を溜め、その後のスキルやＵＢで物防\n一定無視のダメージを連発し、才気煥発の活躍を見せる。", "いろは", 1, 5, 0, 0, "2025/06/20 12:00:00", 0, 0, 132401, 132401, 0, 2.09, 132401);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (636, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 132501, 0, "ソノ", 0, "【魔法】後衛で、小柄で大人対応な錬金堂の省エネ店主。\n強力な弱体効果を与えながら、デバフ付与のたび増加する\n【虚脱】が80溜まると本気を出し定時厳守で戦い抜く。", "その", 2, 7, 0, 23, "2025/05/15 15:00:00", 0, 0, 132501, 132501, 0, 2.09, 132501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (750, 450, 0, 3, 0, "2025/12/15 14:59:59", 0, 132801, 1, "ライラエル（クリスマス）", 0, "【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。", "らいらえる", 2, 7, 0, 0, "2025/11/30 12:00:00", 0, 0, 132801, 132801, 0, 2.09, 132801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (748, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 132901, 0, "イオ（クリスマス）", 0, "【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。", "いお", 2, 5, 0, 46, "2024/12/09 12:00:00", 0, 0, 132901, 132901, 0, 2.09, 132901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (234, 450, 0, 3, 0, "2025/11/03 11:59:59", 0, 133001, 1, "グレイス", 0, "【物理】前衛で、宙を舞うように戦う幽霊の守護騎士。\nＵＢで味方の攻撃と速度支援を行い、【レイスボディ】で\n敵の目を逃れ、不意を突く一撃で永遠の眠りにつかせる。", "ぐれいす", 1, 0, 0, 0, "2025/10/31 12:00:00", 0, 0, 133001, 133001, 0, 2.09, 133001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (154, 450, 0, 3, 0, "2025/11/03 11:59:59", 0, 133101, 1, "ヴァイオレット", 0, "【物理】前衛で、儚くも凛と咲くジオ・ニヴルヘルの姫。\n継続ダメージ効果を鈍化させる環境効果【忌火】で盾に、\n絶怠霊度の継続割合攻撃で矛となり、静寂の冥府を護る。", "うぁいおれっと", 1, 0, 0, 0, "2025/10/31 12:00:00", 0, 0, 133101, 133101, 0, 1.75, 133101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (296, 450, 0, 1, 0, "2030/12/31 15:00:00", 0, 133201, 1, "モニカ（ニューイヤー）", 0, "【物理】前衛で、元日も元気にはしゃぎまわる軍人少女。\n与ダメージに応じて追加効果が強化されるＵＢと、発動ご\nとに成長する自己強化スキルで秩序を乱す者の目を回す。", "もにか", 1, 4, 1, 22, "2024/12/31 12:00:00", 0, 0, 133201, 133201, 0, 2.09, 133201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (718, 450, 0, 3, 0, "2025/07/23 11:59:59", 0, 133501, 1, "サレン（ニューイヤー）", 0, "【魔法】後衛で、傍らで心を重ねる振袖姿の救護院の主。\n味方へのＴＰ回復の支援をしつつ、味方がＵＢを発動する\nたびダメージが上がるスキルで、共に困難を乗り越える。", "されん", 2, 4, 0, 22, "2025/07/10 12:00:00", 0, 0, 133501, 133501, 0, 2.09, 133501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (445, 450, 0, 3, 0, "2025/07/31 11:59:59", 0, 133601, 1, "メドゥーサ", 0, "【物理】中衛で眷属と力を合わせて戦う誇り高き蛇乙女。\n【魔眼】の数に応じて効果量が上がるスキルのダメージと\n弱体化で範囲内の敵を追い詰め、鋭い瞳で石へと変える。", "めどぅーさ", 1, 0, 0, 0, "2025/07/23 12:00:00", 0, 0, 133601, 133601, 0, 2.09, 133601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (717, 450, 0, 3, 0, "2025/08/22 11:59:59", 0, 133701, 1, "ラビリスタ（アルファ）", 0, "【魔法】後衛で、始原の冠装を使いこなす『迷宮女王』。\n水属性の味方のＴＰ上昇を増加する領域を作り、連射攻撃\nで敵の防御を撃ち抜くことで七冠の力を敵に知らしめる。", "らびりすた", 2, 8, 0, 0, "2025/08/15 15:00:00", 0, 0, 133701, 133701, 0, 2.09, 133701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (759, 450, 0, 3, 0, "2025/08/22 11:59:59", 0, 133801, 1, "ネネカ（アルファ）", 0, "【魔法】後衛から、始原の姿で戦況を操る『変貌大妃』。\n召喚したグレゴールから攻撃支援とＴＰ回復を受け、互い\nの魔力を合わせた連携攻撃で、幽玄なる玉座に君臨する。", "ねねか", 2, 7, 0, 0, "2025/08/15 15:00:00", 0, 0, 133801, 133801, 0, 2.09, 133801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (228, 450, 0, 3, 0, "2025/08/22 11:59:59", 0, 133901, 1, "クリスティーナ（アルファ）", 0, "【物理】前衛で、始原の冠装の力を振るう『誓約女君』。\n10行動目に攻撃力を大幅アップし、スキルに追撃を発生\nさせる【虚数】を得て隔絶した力で楯突く敵を抹消する。", "くりすてぃーな", 1, 6, 0, 0, "2025/08/15 15:00:00", 0, 0, 133901, 133901, 0, 2.09, 133901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (746, 450, 0, 3, 0, "2025/11/03 11:59:59", 0, 134001, 1, "フィオ", 0, "【魔法】後衛で、アストルムの冒険へと導くガイド妖精。\nバフとバリアで味方を護りバリアを起点とする攻撃支援、\n風属性の味方への行動速度とＴＰの支援で仲間を支える。", "ふぃお", 2, 0, 0, 0, "2025/10/31 12:00:00", 0, 0, 134001, 134001, 0, 2.09, 134001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 3, 0, "2030/12/31 15:00:00", 0, 134101, 1, "フブキ", 0, "", "ふぶき", 0, 5, 0, 1, "2015/04/01 15:00:00", 0, 0, 134101, 0, 0, 0.0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 3, 0, "2030/12/31 15:00:00", 0, 134201, 1, "ライラエル（クリスマス）", 0, "", "らいらえる", 0, 7, 0, 1, "2015/04/01 15:00:00", 0, 0, 134201, 0, 0, 0.0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (778, 450, 0, 3, 0, "2025/09/30 11:59:59", 0, 134301, 1, "ランファ（儀装束）", 0, "【魔法】後衛で儀装束を纏い精霊と心を通わせる唱喚士。\n敵の数に応じてダメージ量が変化する範囲攻撃や、魔法\n無効バリアなどの支援スキルで想いを詩に乗せ響かせる。", "らんふぁ", 2, 7, 0, 0, "2025/09/16 15:00:00", 0, 0, 134301, 134301, 0, 2.09, 134301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (773, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 134401, 0, "チカ（儀装束）", 0, "【魔法】後衛で儀装束を纏い歌を紡ぎ伝えていく唱喚士。\n自分と最も近くの味方へ強力なバフとＴＰ回復を行うこと\nで攻撃を支援し、共に心を通わせ美しき旋律を奏でる。", "ちか", 2, 7, 0, 21, "2025/03/15 15:00:00", 0, 0, 134401, 134401, 0, 2.09, 134401);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (719, 450, 0, 3, 0, "2025/11/14 14:59:59", 0, 134501, 1, "クローチェ（エアリアル）", 0, "【魔法】後衛で超速飛行からの大火力を叩き込むロボ娘。\n上空から速度バフで味方全体を支援しつつ、自分のバリア\nを解除して力へと変え、世界の命運を背負い飛翔する！", "くろーちぇ", 2, 0, 0, 0, "2025/11/03 12:00:00", 0, 0, 134501, 134501, 0, 2.09, 134501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (526, 450, 0, 3, 0, "2025/11/14 14:59:59", 0, 134601, 1, "アオイ（パイロット）", 0, "【物理】中衛で巨大ロボを駆り戦うぼっちのパイロット。\n敵の弱体化や、味方へバリアを展開するスキルを持ち、\n鋼鉄の乙女から放つ光線はいかに堅固な守りも打ち破る。", "あおい", 1, 35, 0, 35, "2025/11/03 12:00:00", 0, 0, 134601, 134601, 0, 2.09, 134601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (490, 450, 0, 3, 0, "2025/11/14 14:59:59", 0, 134701, 1, "ホウオウ", 0, "【物理】中衛で、華麗に舞い踊る五色絢爛な煉華の鳳凰。\n攻撃力バフやバリア展開などの攻防支援と、多彩で豊富な\nＨＰ・ＴＰ供給を両立し、浄化の力で皆に安寧を授ける。", "ほうおう", 1, 7, 0, 7, "2025/11/03 12:00:00", 0, 0, 134701, 134701, 0, 2.09, 134701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (485, 450, 0, 3, 0, "2025/06/10 11:59:59", 0, 134801, 1, "ツムギ（ジオ・ゲヘナ）", 0, "【物理】中衛から、新たな素材で紡ぐワイルドテーラー。\n最も物攻が高い他の味方へ重複速度アップやＴＰ・攻撃支\n援を仕立て、全体へのＨＰ回復と併せ攻守を両立させる。", "つむぎ", 1, 1, 0, 1, "2025/05/31 12:00:00", 0, 0, 134801, 134801, 0, 1.84, 134801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (196, 450, 0, 3, 0, "2025/06/20 11:59:59", 0, 134901, 1, "カノン", 0, "【物理】前衛で、おエレガントな高笑いを轟かすド令嬢。\nＵＢや敵からの攻撃で【お堪忍袋】が尽きると逆上し、強\n化されたスキルと行動パターンで華麗におリベンジする。", "かのん", 1, 2, 0, 0, "2025/06/10 12:00:00", 0, 0, 134901, 134901, 0, 2.09, 134901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (785, 450, 0, 3, 0, "2025/07/10 11:59:59", 0, 135001, 1, "エリス（サマー）", 0, "【魔法】後衛で、永く夢見た本物の夏に咲き綻ぶ黒薔薇。\n【いばらの冠】の呪縛は再臨により解き放たれ、調和状態\nや攻防支援、回復効果を施し、月下の浜辺に静かに佇む。", "えりす", 2, 7, 0, 21, "2025/06/30 12:00:00", 0, 0, 135001, 135001, 0, 2.09, 135001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (143, 450, 0, 3, 0, "2025/07/23 11:59:59", 0, 135101, 1, "シェフィ（サマー）", 0, "【物理】前衛で盛夏の白波を華麗に乗りこなす氷竜少女。\n敵全体を挑発し、被弾で溜まる【ぐずぐず】をＵＢで発散\nすることで周囲に攻撃支援と天真爛漫な笑顔を振りまく。", "しぇふぃ", 1, 4, 0, 4, "2025/07/10 12:00:00", 0, 0, 135101, 135101, 0, 2.09, 135101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (548, 450, 0, 3, 0, "2025/07/31 11:59:59", 0, 135201, 1, "プレシア（サマー）", 0, "【魔法】中衛で夏の食を満喫し、ぷかぷか漂う天然少女。\nＴＰ・攻撃支援やバリアは味方の数で効果量が変化し、物\n理と魔法攻撃力合算のダメージで夏の思い出を心に刻む。", "ぷれしあ", 2, 7, 0, 7, "2025/07/23 12:00:00", 0, 0, 135201, 135201, 0, 2.09, 135201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (413, 450, 0, 3, 0, "2025/08/10 11:59:59", 0, 135301, 1, "クリア（サマー）", 0, "【物理】中衛で友情の芽を育む、真夏の『普通』の少女。\n【プルメリアのお守り】で強力な一撃から先頭を守り、味\n方の数で効果量が変化するスキルを鮮やかに命中させる。", "くりあ", 1, 54, 0, 54, "2025/07/31 12:00:00", 0, 0, 135301, 135301, 0, 2.09, 135301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (553, 450, 0, 3, 0, "2025/08/15 14:59:59", 0, 135401, 1, "アネモネ（サマー）", 0, "【魔法】中衛で砂浜の木陰に微睡むアルラウネの妖魔人。\n行動速度アップや初回使用時に回復量が増加するＴＰ回復\nを起点に支援し、穏やかな木漏れ日と共にゆらゆら憩う。", "あねもね", 2, 2, 0, 52, "2025/08/10 12:00:00", 0, 0, 135401, 135401, 0, 2.09, 135401);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (213, 450, 0, 3, 0, "2025/11/03 11:59:59", 0, 135501, 1, "アイラ", 0, "【物理】前衛で、世界を守り笑顔を咲かせる情熱の豪炎。\n前方の敵全てを対象とする連撃の強化通常攻撃や、天楼覇\n断剣から放たれる極大ダメージの一閃で未来を切り拓く。", "あいら", 1, 1, 0, 0, "2025/10/31 12:00:00", 0, 0, 135501, 135501, 0, 2.09, 135501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (198, 450, 0, 3, 0, "2025/11/03 11:59:59", 0, 135601, 1, "シナツ", 0, "【物理】前衛から、風裂く刃で世界を護る孤高の剣豪。\n卓越した剣技で敵の攻撃を捌いて反撃し、初回ＵＢで生成\nする分身と共に疾風迅雷の攻めで、未来へと駆け抜ける。", "しなつ", 1, 4, 0, 0, "2025/10/31 12:00:00", 0, 0, 135601, 135601, 0, 0.4, 135601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (291, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 135701, 0, "ヒヨリ（サラサリア）", 0, "【物理】前衛で、二人きりの月下の空旅にときめく黒猫。\n物防弱体の他、ダメージ100ヒット後には華麗なステップ\nの追撃とＴＰ回復量増加で、砂漠の夜空に花を咲かせる。", "ひより", 1, 1, 0, 0, "2025/09/16 15:00:00", 0, 0, 135701, 135701, 0, 1.84, 135701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (830, 450, 0, 3, 0, "2025/10/10 11:59:59", 0, 135801, 1, "ユキノ", 0, "【魔法】後衛から、雪魄氷姿の三味を弾じる初心な雪女。\n多様なデバフ効果で敵を弱体化させ、最も魔防の低い敵の\n状態に応じて発生する追加効果で、冥府を真白に染める。", "ゆきの", 2, 7, 0, 0, "2025/09/30 12:00:00", 0, 0, 135801, 135801, 0, 2.09, 135801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (219, 450, 0, 3, 0, "2025/10/24 11:59:59", 0, 135901, 1, "サツキ", 0, "【物理】前衛で、華奢な体躯に厚い仁義を宿す鬼のお嬢。\n攻防自己強化や行動不能無効化で豪胆に立ち続け、自分が\n呪詛状態の時に振るう追加攻撃で、怪力無双の力を示す。", "さつき", 1, 3, 0, 0, "2025/10/10 12:00:00", 0, 0, 135901, 135901, 0, 1.84, 135901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (732, 450, 0, 3, 0, "2025/11/03 11:59:59", 0, 136001, 1, "アラクネ", 0, "【物理】後衛で、喪われた光を求めてもがく元『六凶』。\n敵のＵＢを遅延する【遮絶の操糸】や、味方単体のＵＢを\n連続発動可能にする【賦活の糸】を戦場に張り巡らせる。", "あらくね", 1, 11, 0, 0, "2025/10/31 12:00:00", 0, 0, 136001, 136001, 0, 2.09, 136001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (432, 450, 1, 3, 0, "2025/11/03 11:59:59", 0, 136101, 1, "サクラ", 0, "【物理】中衛で不運に抗い歌い続けるゾンビィアイドル。\n一度倒れても立ち上がり、ＴＰを糧に強化されるスキルの\nダメージと味方の支援で、サガの心をアストルムに刻む。", "さくら", 1, 0, 0, 0, "2025/10/24 12:00:00", 0, 0, 136101, 136101, 0, 1.74, 136101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (198, 450, 0, 3, 0, "2030/12/31 15:00:00", 0, 136201, 0, "ナーナ", 0, "【物理】前衛でダメダメでも逃げず戦うアルミラージ娘。\n最も近くの味方に強化や行動不能無効の付与、回復を行い\n敵の注意をそらすことで、過酷な世界を生き延びる。", "なーな", 1, 3, 0, 3, "2025/11/14 15:00:00", 0, 0, 136201, 136201, 0, 2.09, 136201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 3, 0, "2030/12/31 15:00:00", 0, 136301, 0, "ミソラ（クリスマス）", 0, "", "みそら", 0, 35, 0, 35, "2015/04/01 15:00:00", 0, 0, 136301, 0, 0, 0.0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (382, 450, 0, 3, 0, "2025/12/15 14:59:59", 0, 136401, 1, "ユイ（クリスマス）", 0, "【魔法】中衛で、騎士の隣に一歩踏み出す聖夜の魔法士。\n敵の注目を集めながら攻防支援を行い【聖夜の愛慕】が\n高まると、ＴＰ支援やダメージカットで優しく包み込む。", "ゆい", 2, 7, 0, 21, "2025/11/30 12:00:00", 0, 0, 136401, 136401, 0, 1.84, 136401);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 1, 0, "2030/12/31 15:00:00", 0, 136601, 0, "メドゥーサ", 0, "", "めどぅーさ", 0, 1, 0, 1, "2015/04/01 15:00:00", 0, 0, 136601, 0, 0, 0.0, 0);
