INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (688, 450, 0, 3, 0, "2025/11/14 14:59:59", 0, 137401, 1, "カスミ（シスター）", 0, "【魔法】後衛で、聖なる光に包まれ微笑み祈るシスター。\n攻防デバフを操り【真実の導き】が集まると最大３キャラ\nへの攻撃が最も魔防の低い敵を追及し、真理を照らす。", "かすみ", 2, 7, 0, 21, "2025/11/03 12:00:00", 0, 0, 137401, 137401, 0, 2.09, 137401);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES (0, 0, 0, 3, 0, "2030/12/31 15:00:00", 0, 137501, 1, "アイラ", 0, "", "あいら", 0, 1, 0, 1, "2015/04/01 15:00:00", 0, 0, 137501, 0, 0, 0.0, 0);
